✨PRO TIP✨ Surround yourself with people on the morning of your wedding that will make you feel peaceful, joyful, and calm. 

Sometimes that means a group of your closest friends and family, and sometimes it’s just 1-2 people! 

👉🏼You don’t need to be in a crowded room if you don’t want to be.

If you prefer a quieter morning, stagger hair and makeup appointments throughout the morning and have each person only come when it’s time for their appointment.  Or, have others get ready at another location and join you after lunch! 

You can still get that bathrobe photo with the full group right before getting dressed.  You will be surrounded by people all afternoon and late into the night, so sometimes a quiet morning is exactly what’s needed 💕

